import styles from "./restaurantList.module.css";

export default function RestaurantList({ places, isOpen, onClose }) {
  return (
    <div className={` ${styles["restaurant-list-container"]} ${isOpen ? styles.open : ''}`}>
      <div className={styles.tab} onClick={onClose}>Close</div>
      <div className={styles["restaurant-list"]}>
        <h2>Restaurants:</h2>
        <ul>
          {places.map((place) => (
            <li key={place.place_id}>{place.name}</li>
          ))}
        </ul>
      </div>
    </div>
  );
}
